@JuliaHB1 @talkRADIO Here's a cool time lapse journey along the Suez Canal

Fun fact: 120 miles of canal water without any locks. At that distance according to spherical geometry there should be over 1 &amp; 3/4 miles in curvature drop, yet we see that it's perfectly level! 😎

